import React from 'react';
import { TableRow, TableData } from '../../Ui/Table';

export interface ProductsTableRowProps {}

const ProductsTableRow: React.SFC<ProductsTableRowProps> = () => {
  return (
    <TableRow key={product.id}>
      <TableData>
        <img
          src="https://picsum.photos/50/50"
          style={{ borderRadius: '8px' }}
        />
      </TableData>
      <TableData>{product.title}</TableData>
      <TableData>${product.price.toFixed(2)}</TableData>
      <TableData>{product.inventory} in stock</TableData>
    </TableRow>
  );
};

export default TableRow;
